THE COLORS OF LOVE: You've gotta be with someone who boldly and proudly champions you. Who acknowledges how important you are to them. Who puts his pride and angst aside and moves closer to you. Who would choose you over millions of others. Over his own petty fears. Over his image, persona, public identity. Who would willingly make an ass of himself to get your attention. Who would move mountains to gain your affection. This is so crucial. To know what you deserve. To never settle. To not have to jump through flaming hoops to be seen. To be adored, admired, honored and cherished: openly. To drop all smoke & mirrors. Someone who sees the kaleidoscope colors of you. And doesn't run. But comes closer and deeper and braver every day. This. Knowing that you'll be met and caught and held. And that you mean more than the world to someone who has always chased the world. That you are not a secret. That you are the chosen beloved. That you are precious and intrinsic to his growth and evolution. And he recognizes that. And generously shares himself with you. No withholding. No hiding. No BS. That kind of union is not only possible...but inevitable. You keep showing your own colors. And the one whose colors will dance with yours will keep showing his. And love will move you both forward. And in the meantime, you laugh, cry, shrug, lean in, lean back and...breathe. #learning #loving #justbreathe";}i:17;a:1:{s:14:"comments_count";i:0;}i:18;a:1:{s:11:"likes_count";i:0;}i:19;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEut0RRAxtw";}i:20;a:1:{s:5:"image";s:239:"https://scontent-sin6-1.cdninstagram.com/v/t51.2885-15/e35/118709469_1420809391445706_2394177756825560168_n.jpg?_nc_ht=scontent-sin6-1.cdninstagram.com&_nc_cat=106&_nc_ohc=hJyYpttAiSQAX8Sy97w&oh=62f460897ebe43fee6291325f403e088&oe=5F7AD2B7";}i:21;a:1:{s:4:"type";s:5:"image";}i:22;a:1:{s:8:"owner_id";i:6608292072;}i:23;a:1:{s:14:"owner_username";s:0:"";}i:24;a:1:{s:14:"owner_fullname";s:0:"";}i:25;a:1:{s:9:"owner_pic";s